import "./Navbarstyling.css";
import { Link } from "react-router-dom";

import React from "react";

const Navbar = () => {
  return (
    <div className="Header">
      <link to={"/"}>
        <link />
        <h1>Porfolio</h1>
      </link>
    </div>
  );
};

export default Navbar;
